INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.4, "お！\nあそこに困ってそうな人発見！", 2, 1, "春咲 ひより", 1, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1, 0, 1001, 0, 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.4, "大切な人を\n守れるようになりたい…って", 2, 1, "草野 優衣", 1, "わ、わたし、\nなに言ってるんだろ\nあはは…", 1, 0, 1002, 0, 0, "みんなみたいに\nわたしも強くならなきゃ", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.4, "キミに必要な集中力と感性が", 2, 1, "士条 怜", 1, "少しは磨かれると思いますよ。", 1, 0, 1003, 0, 0, "フェンシングを始めてみては？", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.5, "今日はなにして遊ぶ？", 2, 1, "穂高 みそぎ", 1, "みそぎはねぇ、\nかくれんぼやりたい！", 1, 0, 1004, 0, 0, "ねぇ、にいちゃん！", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.4, "ねぇ…", 2, 1, "風宮 あかり", 1, "私といっしょに…\nいかない？", 1, 0, 1006, 0, 0, "風宮あかりです", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.5, "プリンたべたいのー", 2, 1, "出雲 宮子", 1, "食べ物の恨みは怖いのー", 1, 0, 1007, 0, 0, "出雲宮子なのー", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.4, "キミもボクの美貌に\n吸い寄せられたんだね。", 2, 1, "虹村 雪", 1, "いいよ。\n見られることは運命さ…", 1, 0, 1008, 0, 0, "ボクは虹村雪。", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.4, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 2, 1, "柊杏奈", 1, "人呼んで「疾風の冥姫」!!", 1, 0, 1009, 0, 0, "フッ…聞いて後悔するがいい！", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.5, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 2, 1, "姫宮 真歩", 1, "ほんまおおきにやわ～♪", 1, 0, 1010, 0, 0, "マホマホ王国のプリンセス、\nまほ姫どす", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.4, "生き別れたお兄ちゃんを探して\n三千世界！", 2, 1, "衣之咲 璃乃", 1, "ここで会ったが\n100年目～！", 1, 0, 1011, 0, 0, "衣之咲璃乃です！", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.4, "ち、超能力って…\n何のことかな～？", 2, 1, "柏崎 初音", 1, "…って、お願い！\n誰にも言わないでおいて～！", 1, 0, 1012, 0, 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.4, "一応カリスマ読モJKやってまっす！", 2, 1, "美波 鈴奈", 1, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1, 0, 1016, 0, 0, "ちょす！\n美波鈴奈だよ～♪", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.4, "東京は遊園地みたいなところさー", 2, 1, "喜屋武 香織", 1, "でも、沖縄もとってもいいとこさー", 1, 0, 1017, 0, 0, "はいたーい。\n喜屋武香織さー。", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.4, "先生って呼ばれるのは\nくすぐったいから", 2, 1, "支倉 伊緒", 1, "イオちゃんって呼んでね。", 1, 0, 1018, 0, 0, "支倉伊緒です。", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.5, "あ！/\お兄ちゃ～ん\nまってよ～", 2, 1, "茜 ミミ", 1, "ミミをおいてかないでぇ～", 1, 0, 1020, 0, 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.5, "あの……\nふぇ……", 2, 1, "栗林 くるみ", 1, "ふぇぇぇぇぇん……", 1, 0, 1021, 0, 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.4, "こんな私に貴重な時間を\n割いていただき、", 2, 1, "風宮 より", 1, "なんてありがとうございます！", 1, 0, 1022, 0, 0, "風宮よりです。\nあああああ！", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.5, "おにいちゃんどこいくの？\nえ？", 2, 1, "北条 綾音", 1, "私こっち行きたいー\nね、早く早くー", 1, 0, 1023, 0, 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.4, "ふ、不束者ですが\nどうぞ末永く…って、", 2, 1, "天野 すずめ", 1, "これて何か違う…\nあああすみません！", 1, 0, 1025, 0, 0, "わっ…わっ…私、\n天野すずめといいます！", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.4, "あなたは…運命の……\n伴侶……", 2, 1, "倉石 恵理子", 1, "離しませんわ………\n絶対に…!!", 1, 0, 1027, 0, 0, "……クスクス…私は\n…倉石恵理子……", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.4, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 2, 1, "佐々木 咲恋", 1, "…そうでしょ？？", 1, 0, 1028, 0, 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.4, "ぇっと…\nキミ、私のこと知らないの?!", 2, 1, "桜井 望", 1, "あはは、\n私もまだまだだなぁ～", 1, 0, 1029, 0, 0, "桜井望だよ！\nよろしくねっ", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.4, "初めまして、\n私はニノン・ジュベール申すデス！", 2, 1, "ニノン・ジュベール", 1, "ショーグン、\nワタシと一緒に天下統一デース！", 1, 0, 1030, 0, 0, "デケデケデンっ！", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.4, "でもって私の隣にいるのが……\nえ、見えない？", 2, 1, "上喜 しのぶ", 1, "おかしいですね……", 1, 0, 1031, 0, 0, "上喜しのぶです。\n手元のドクロが父です。", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.5, "けんども\nそれには足りないモンが…", 2, 1, "野戸まひる", 1, "そう、\nオラのボケに突っ込める相方が…！", 1, 0, 1033, 0, 0, "目指すはビッグな\nお笑い芸人だっぺ！", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.4, "ちょっと緊張しちゃって…", 2, 1, "綾瀬 ゆかり", 1, "ちょ\nちょっと一杯飲んできます…！", 1, 0, 1034, 0, 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.5, "知らない人とは話しちゃいけないので", 2, 1, "氷川 鏡華", 1, "これ以上お話しすることは…\nないです！", 1, 0, 1036, 0, 0, "氷川鏡華…です", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.4, "……あ、アラーム。", 2, 1, "柏崎 栞", 1, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1, 0, 1038, 0, 0, "柏崎…栞です。", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.4, "私、一人も友達がいなくて……", 2, 1, "双葉 碧", 1, "野に咲く花が、\n唯一の話相手です。", 1, 0, 1040, 0, 0, "ふ、双葉碧です。", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.4, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 2, 1, "三角 千歌", 1, "そう思っています。", 1, 0, 1042, 0, 0, "三角千歌です。", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.4, "あぁ？\nお前のそいつの仲間か？", 2, 1, "安芸 真琴", 1, "う、疑ってすまなかったな…", 1, 0, 1043, 0, 0, "安芸真琴だ。", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.4, "生けとし生ける全ての者よ！", 2, 1, "イリヤ・オーンスタイン", 1, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1, 0, 1044, 0, 0, "わらわこそは夜を総べる者！", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.4, "ぐふふふふ……はっ！", 2, 1, "遠見 空花", 1, "ｌク、クウカに何かご用ですか!?", 1, 0, 1045, 0, 0, "そこで騎士は妖精を乱暴に……", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.4, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 2, 1, "宮坂たまき", 1, "う～ん…\n猫ってホントに最高にゃ～♪", 1, 0, 1046, 0, 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.4, "それでは早速クエストに…", 2, 1, "大神 美冬", 1, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1, 0, 1048, 0, 0, "大神美冬よ！", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.4, "クエストもバトルも\n掃除も洗濯も", 2, 1, "星野静流", 1, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1, 0, 1049, 0, 0, "星野静流だよ！", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.5, "見ての通りの\nセクシー美少女で", 2, 1, "玉泉美咲", 1, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1, 0, 1050, 0, 0, "アタシは玉泉美咲。", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.4, "？？？？", 2, 1, "リマ", 1, "？？？？", 1, 0, 1052, 0, 0, "？？？", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.5, "菓子でつろうなどと\n稚拙な策を……", 2, 1, "モニカ・ヴァイスヴィント", 1, "そ、そこまでいうなら\nもらってやる", 1, 0, 1053, 0, 0, "モニカ・ヴァイスヴィントだ。", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.5, "菓子でつろうなどと\n稚拙な策を……", 2, 1, "ペコリーヌ", 1, "そ、そこまでいうなら\nもらってやる", 1, 0, 1058, 0, 0, "モニカ・ヴァイスヴィントだ。", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.5, "菓子でつろうなどと\n稚拙な策を……", 2, 1, "コッコロ", 1, "そ、そこまでいうなら\nもらってやる", 1, 0, 1059, 0, 0, "モニカ・ヴァイスヴィントだ。", 0, 0);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (1.5, "菓子でつろうなどと\n稚拙な策を……", 2, 1, "キャル", 1, "そ、そこまでいうなら\nもらってやる", 1, 0, 1060, 0, 0, "モニカ・ヴァイスヴィントだ。", 0, 0);
